    public void executeQuery(String s)
    {
        SQLiteDatabase sqlitedatabase = getWritableDatabase();
        if (sqlitedatabase == null)
        {
            return;
        }
        sqlitedatabase.execSQL(s);
 
        try
        {
            sqlitedatabase.close();
            return;
        }
        catch(Exception e)
        {
        	e.printStackTrace();
        }
         
    }

    

     public ArrayList getDetails(String s)
    {
        Cursor cursor;
        ArrayList arraylist = null;
       
        System.out.println("TEST req :"+s);
        arraylist = new ArrayList();
        SQLiteDatabase sqlitedatabase;
        
        try
        {
            sqlitedatabase = getWritableDatabase();
        }
        // Misplaced declaration of an exception variable
        catch (Exception e)
        {
            Log.d("Exception", e.getMessage());
            return null;
        }
        cursor = null;
        if (sqlitedatabase == null)
        {
            return null;
        }
        cursor = sqlitedatabase.rawQuery(s, null);
        if(cursor==null)
        {
        	return null;
        }
        
        System.out.println("TEST place cound:"+cursor.getCount());
        
        if(cursor.getCount()>0)
        {
        
        		int j=cursor.getColumnCount();
          cursor.moveToFirst();
           do {
			
        	   String name="";
        	  for(int i=0;i<j;i++)
        	  {
        		  name=name+cursor.getString(i)+",";
        	  }
        	    
        	   arraylist.add(name);
        	   
		} while ( cursor.moveToNext()); 
 
          
        } 
        if(cursor!=null)
            cursor.close();
        
            if(sqlitedatabase!=null)
            sqlitedatabase.close();
           
           return arraylist;
    } 

   
