    public void onCreate(SQLiteDatabase sqlitedatabase)
    {
          sqlitedatabase.execSQL("CREATE TABLE IF NOT EXISTS india_master (sno INTEGER PRIMARY KEY AUTOINCREMENT,code VARCHAR(10),town VARCHAR(50),district VARCHAR(50),state VARCHAR(50))");
         }

    public void onUpgrade(SQLiteDatabase sqlitedatabase, int i, int j)
    {
    	  sqlitedatabase.execSQL("DROP TABLE IF EXISTS india_master");
       
        onCreate(sqlitedatabase);
    }

   
